import React, { useState }from 'react';
import logo from './logo.svg';
import './App.css';

function App() {

  const [fade, setFade] = useState(false);

  return (
    <div className="App">
      <header className={fade ? "App-header hidden" : "App-header"}>
        <h2>How's it hangin', homeslice</h2>
        <button onClick={() => setFade(!fade)}>
        Click me
      </button>
      </header>
    </div>
  );
}

export default App;
